(1,1,1,'Delivery','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2>\n<h3>Your pack shipment</h3>\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
(1,2,1,'Koszty wysyłki','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.3125rem;text-align:justify;\">Koszty wysyłki :</h2>\n<h2 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.3125rem;text-align:justify;\"><span style=\"color:#4a4a4a;\">PRZY ZAKUPACH POWYŻEJ 200 ZŁ <span style=\"color:#d0121a;\">DARMOWA PRZESYŁKA</span> (tylko na terenie POLSKI, wartość produktów musi przekroczyć 200 ZŁ)!!!</span></h2>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"></p>\n<h2 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.3125rem;text-align:justify;\"><span style=\"color:#4a4a4a;\">Przy zakupach powyżej <span style=\"color:#7cd320;\">150 zł darmowa przesyłka</span> do punktów poczty polskiej oraz AUTOMATÓW PACZKOWYCH( Tylko na terenie POLSKI, wartość produktów musi przekroczyć 150 zł)!!!</span></h2>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"></p>\n<h3 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.125rem;text-align:justify;\">Przesyłki krajowe</h3>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">Dokładamy wszelkich starań by zamówienia były realizowane niezwłocznie.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">Dostępne formy wysyłki :</p>\n<h3 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.125rem;text-align:justify;\"><span style=\"font-weight:bolder;\">Poczta Polska dostawa do domu </span>w cenie<span style=\"font-weight:bolder;\">  <span style=\"color:#7cd320;\">10,99</span> zł </span></h3>\n<h3 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.125rem;text-align:justify;\"><span style=\"font-weight:bolder;\">Poczta Polska </span>płatność przy odbiorze w cenie<span style=\"font-weight:bolder;\"> <span style=\"color:#7cd320;\">13,99 </span>zł</span></h3>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"></p>\n<h3 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.125rem;text-align:justify;\">Kurierem Inpost<span style=\"font-weight:bolder;\"> </span>w cenie<span style=\"font-weight:bolder;\"> <span style=\"color:#7cd320;\">13,99</span> zł</span></h3>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"></p>\n<h3 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.125rem;text-align:justify;\"><span style=\"font-weight:bolder;\">Paczkomaty Inpost w cenie <span style=\"color:#7cd320;\">10,50</span> zł</span></h3>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"></p>\n<h2 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.3125rem;text-align:justify;\"><span style=\"color:#7cd320;\"><span style=\"font-weight:bolder;\">Poczta Polska dostawa do punktu oraz AUTOMATÓW PACZKOWYCH w cenie 8,99 zł</span></span></h2>\n<h3 style=\"margin-top:0px;color:#232323;margin-bottom:0.5rem;font-family:Manrope, sans-serif;line-height:1.1;font-size:1.125rem;text-align:justify;\"></h3>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">Do każdego zamówienia dołączamy paragon a na życzenie<span style=\"font-weight:bolder;\"> fakturę VAT</span></p>','koszty-wysylki'),
(2,1,1,'Legal Notice','','Legal notice','notice, legal, credits','<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Online store was created using <a href=\"http://www.prestashop.com\">Prestashop Shopping Cart Software</a>,check out PrestaShop\'s <a href=\"http://www.prestashop.com/blog/en/\">ecommerce blog</a> for news and advices about selling online and running your ecommerce website.</p>','legal-notice'),
