(3,2,1,'Regulamin sklepu','','Our terms and conditions of use','conditions, terms, use, sell','<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>REGULAMIN SKLEPU INTERNETOWEGO karolinaszydelko.pl obowiązuje od 2017.02.17</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>I. Definicje</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">Użyte w Regulaminie pojęcia oznaczają:</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">1. <span>Klient</span> – osoba fizyczna, osoba prawna lub jednostka organizacyjna niebędąca osobą prawną, której przepisy szczególne przyznają zdolność prawną, która dokonuje Zamówienia w ramach Sklepu;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2. <span>Kodeks Cywilny</span> – ustawa z dnia 23 kwietnia 1964 r. (Dz.U. Nr 16, poz. 93 ze zm.);</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">3. <span>Regulamin</span> – niniejszy Regulamin świadczenia usług drogą elektroniczną w ramach sklepu internetowego karolinaszydelko.pl;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4. <span>Sklep internetowy (Sklep)</span> – serwis internetowy dostępny pod adresem URL www.karolinaszydelko.pl , za pośrednictwem którego Klient może w szczególności składać Zamówienia;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">5. <span>Towar</span> – produkty prezentowane w Sklepie Internetowym;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">6. <span>Umowa sprzedaży</span> – umowa sprzedaży Towarów w rozumieniu Kodeksu Cywilnego, zawarta pomiędzy Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460  a Klientem, zawierana z wykorzystaniem serwisu internetowego Sklepu;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">7. <span>Ustawa o prawach konsumenta</span> – ustawa z dnia 30 maja 2014 r. o prawach konsumenta (Dz.U. z 2014 r. poz. 827);</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">8. <span>Ustawa o świadczeniu usług drogą elektroniczną</span> – ustawa z dnia 18 lipca 2002 r. o świadczeniu usług drogą elektroniczną (Dz. U. Nr 144, poz. 1204 ze zm.);</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">9. <span>Zamówienie</span> – oświadczenie woli Klienta, zmierzające bezpośrednio do zawarcia Umowy sprzedaży, określające w szczególności rodzaj i liczbę Towaru. +</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">10. Sprzedawca - Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań<br /><br /><span>II. Postanowienia ogólne</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.1. Niniejszy Regulamin określa zasady korzystania ze sklepu internetowego dostępnego pod karolinaszydelko.pl.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.2. Niniejszy Regulamin jest regulaminem, o którym mowa w art. 8 Ustawy o świadczeniu usług drogą elektroniczną.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.3. Właścicielem sklepu internetowy, działającego pod adresem URL karolinaszydelko.pl, jest Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460, a<span>dres do korespondencji / adres do zwrotu towaru: </span><br />Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>Konto bankowe Sprzedawcy:</span><br /><span>Pekao S.A : 93 1950 0001 2006 0062 1633 0001</span><br /><span>SWIFT banku: IEEAPLPA</span><br /><br /><span>Zapytania mogą być kierowane na adres poczty elektronicznej</span><br /><span>kontakt@karolinaszydelko.pl</span><br /><span>lub na numer telefonu </span><br /><span>509904006 </span><br /><span>Kontakt telefoniczny z obsługą sklepu jest możliwy od poniedziałku do piątku w godzinach od 8:00 do 16:00</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.4. Niniejszy Regulamin określa w szczególności:</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">a) zasady dokonywania rejestracji i korzystania z konta w ramach sklepu internetowego;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">b) warunki i zasady dokonywania elektronicznej rezerwacji produktów dostępnych w ramach sklepu internetowego;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">c) warunki i zasady składania drogą elektroniczną Zamówień w ramach sklepu internetowego;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">d) zasady zawierania Umów sprzedaży z wykorzystaniem usług świadczonych w ramach Sklepu Internetowego.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.5. Korzystanie ze sklepu internetowego jest możliwe pod warunkiem spełnienia przez system teleinformatyczny, z którego korzysta Klient następujących minimalnych wymagań technicznych:</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">a) przeglądarka internetowa z włączoną obsługą <span>HTML, CSS, JavaScript;</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">b) włączona obsługa języka JavaScript oraz włączona obsługa plików Cookies;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">c) aktywne konto e-mail;</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.6. W celu korzystania ze sklepu internetowego Klient powinien we własnym zakresie uzyskać dostęp do stanowiska komputerowego lub urządzenia końcowego, z dostępem do Internetu.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.7. Zgodnie z obowiązującymi przepisami prawa Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460 zastrzega sobie możliwość ograniczenia świadczenia usług za pośrednictwem Sklepu internetowego do osób, które ukończyły wiek 18 lat. W takim przypadku potencjalni Klienci zostaną o powyższym powiadomieni.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.8. Klienci mogą uzyskać dostęp do niniejszego Regulaminu w każdym czasie za pośrednictwem odsyłacza zamieszczonego na stronie głównej serwisu http://karolinaszydelko.pl/content/3-terms-and-conditions-of-use?live_configurator_token=abfba79ada7fa5cb76517363d8ba4e42&amp;id_shop=1&amp;id_employee=1&amp;theme=&amp;theme_font= oraz pobrać go i sporządzić jego wydruk.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">2.9. Informacje o Towarach podane na stronach internetowych Sklepu, w szczególności ich opisy, parametry techniczne i użytkowe oraz ceny, stanowią zaproszenie do zawarcia umowy, w rozumieniu art. 71 Kodeksu Cywilnego.<br /><br /><span>III. Zasady korzystania ze Sklepu Internetowego</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">3.1. Warunkiem rozpoczęcia korzystania ze Sklepu internetowego jest rejestracja w jego ramach.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">3.2. Rejestracja następuje poprzez wypełnienie i zaakceptowanie formularza rejestracyjnego, udostępnianego na jednej ze stron Sklepu.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">3.3. Warunkiem rejestracji jest wyrażenie zgody na treść Regulaminu oraz podanie danych osobowych oznaczonych jako obowiązkowe.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">3.4. Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460 może pozbawić Klienta prawa do korzystania ze Sklepu Internetowego, jak również może ograniczyć jego dostęp do części lub całości zasobów Sklepu Internetowego, ze skutkiem natychmiastowym, w przypadku naruszenia przez Klienta Regulaminu, a w szczególności, gdy Klient:</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">a) podał w trakcie rejestracji w sklepie internetowym dane niezgodne z prawdą, niedokładne lub nieaktualne, wprowadzające w błąd lub naruszające prawa osób trzecich,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">b) dopuścił się za pośrednictwem sklepu internetowego naruszenia dóbr osobistych osób trzecich, w szczególności dóbr osobistych innych klientów sklepu internetowego,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">c) dopuści się innych zachowań, które zostaną uznane przez Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460 za zachowania niezgodne z obowiązującymi przepisami prawa lub ogólnymi zasadami korzystania z sieci Internet lub godzące w dobre imię Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">3.5. Osoba, która została pozbawiona prawa do korzystania ze sklepu internetowego, nie może dokonać powtórnej rejestracji bez uprzedniej zgody Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">3.6. W celu zapewnienia bezpieczeństwa przekazu komunikatów i danych w związku ze świadczonymi w ramach Witryny usługami, Sklep internetowy podejmuje środki techniczne i organizacyjne odpowiednie do stopnia zagrożenia bezpieczeństwa świadczonych usług, w szczególności środki służące zapobieganiu pozyskiwania i modyfikacji przez osoby nieuprawnione danych osobowych przesyłanych w Internecie.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">3.7. Klient zobowiązany jest w szczególności do:</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">a) niedostarczania i nieprzekazywania treści zabronionych przez przepisy prawa, np. treści propagujących przemoc, zniesławiających lub naruszających dobra osobiste i inne prawa osób trzecich,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">b) korzystania ze Sklepu internetowego w sposób nie zakłócający jego funkcjonowania, w szczególności poprzez użycie określonego oprogramowania lub urządzeń,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">c) niepodejmowania działań takich jak: rozsyłanie lub umieszczanie w ramach Sklepu internetowego niezamówionej informacji handlowej (spam),</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">d) korzystania ze Sklepu internetowego w sposób nieuciążliwy dla innych klientów oraz dla Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">e) korzystania z wszelkich treści zamieszczonych w ramach Sklepu internetowego jedynie w zakresie własnego użytku osobistego,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">f) korzystania ze Sklepu internetowego w sposób zgodny z przepisami obowiązującego na terytorium Rzeczypospolitej Polskiej prawa, postanowieniami Regulaminu, a także z ogólnymi zasadami korzystania z sieci Internet.<br /><br /><span>IV. Procedura zawarcia Umowy sprzedaży</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.1. W celu zawarcia Umowy sprzedaży za pośrednictwem Sklepu internetowego należy wejść na stronę internetową www.karolinaszydelko.pl , dokonać wyboru towaru, jego koloru, podejmując kolejne czynności techniczne w oparciu o wyświetlane Klientowi komunikaty oraz informacje dostępne na stronie.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.2. Wybór zamawianych Towarów przez Klienta jest dokonywany poprzez ich dodanie do koszyka.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.3. W trakcie składania Zamówienia – do momentu naciśnięcia przycisku „Zamawiam” – Klient ma możliwość modyfikacji wprowadzonych danych oraz w zakresie wyboru Towaru. W tym celu należy kierować się wyświetlanymi Klientowi komunikatami oraz informacjami dostępnymi na stronie.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.4. Po podaniu przez Klienta korzystającego ze Sklepu internetowego wszystkich niezbędnych danych, wyświetlone zostanie podsumowanie złożonego Zamówienia. Podsumowanie złożonego Zamówienia będzie zawierać informacje dotyczące:</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">a) przedmiotu zamówienia,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">b) jednostkowej oraz łącznej ceny zamawianych produktów lub usług, w tym kosztów dostawy oraz dodatkowych kosztów (jeśli występują),</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">c) wybranej metody płatności,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">d) wybranego sposobu dostawy,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">e) czasu dostawy,</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.5. W celu wysłania Zamówienia konieczne jest dokonanie akceptacji treści Regulaminu, podanie danych osobowych oznaczonych jako obowiązkowe oraz naciśnięcie przycisku „Zamawiam z obowiązkiem zapłaty”.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.6. Wysłanie przez Klienta Zamówienia stanowi oświadczenie woli zawarcia z Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, NIP:5971680460 Umowy sprzedaży, zgodnie z treścią Regulaminu. 1</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.7. Po złożeniu Zamówienia, Klient otrzymuje wiadomość e-mail zawierającą ostateczne potwierdzenie wszystkich istotnych elementów Zamówienia.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.8. Umowę traktuje się za zawartą z momentem otrzymania przez Klienta wiadomości e-mail, o której mowa powyżej.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">4.9. Umowa sprzedaży zawierana jest w języku polskim, o treści zgodnej z Regulaminem. <br /><br /><span>V. Dostawa</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">5.1. Dostawa Towarów jest ograniczona do obszaru Rzeczpospolitej Polskiej i odbywa się pod adres wskazany przez Klienta w trakcie składania Zamówienia.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">5.2. Dostawa zamówionych Towarów odbywa się przesyłką kurierską lub za pośrednictwem Poczty Polskiej. Koszty dostawy wynoszą w zależności od wagi zamówienia od 9,50 PLN do 28 PLN. Dodatkowo koszty dostawy zostaną wskazane w czasie składania Zamówienia.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">5.3. Termin realizacji dostawy wynosi od 1 do 7 dni roboczych licząc od dnia wysłania przez Klienta Zamówienia.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">5.4. Klienci mogą uzyskać dostęp do niniejszego Regulaminu w każdym czasie za pośrednictwem odsyłacza zamieszczonego na stronie głównej serwisu http://karolinaszydelko.pl/content/3-regulamin-sklepu oraz pobrać go i sporządzić jego wydruk.<br />Utrwalenie, zabezpieczenie, udostępnienie oraz potwierdzenie Klientowi istotnych postanowień Umowy sprzedaży Towarów następuje poprzez przesłanie Klientowi na podany adres e-mail oraz poprzez dołączenie do przesyłki zawierającej Towar wydruku potwierdzenia, specyfikacji Zamówienia oraz faktury VAT.<br /><br /><span>VI. Ceny i metody płatności</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">6.1. Ceny Towarów podawane są w złotych polskich i zawierają wszystkie składniki, w tym podatek VAT (z wyróżnieniem wysokości stawki), cła oraz wszelkie inne składniki.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">6.2. Klient ma możliwość uiszczenia ceny:</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">a) przelewem na numer konta bankowego Pekao S.A : 93 1950 0001 2006 0062 1633 0001</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">b) przelew online dotpay</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">c) <span>płatność przy odbiorze</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><br /><span>VII. Prawo odstąpienia od umowy</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>Na mocy Ustawy z dnia 30 maja 2014r. o prawach konsumenta (Dz.U.2014.827) Konsument ma prawo odstąpić od umowy bez podania przyczyny przez poinformowanie Sklepu o swojej decyzji o odstąpieniu od Umowy w drodze jednoznacznego oświadczenia w terminie 14 dni kalendarzowych od dnia w którym Konsument wszedł w posiadanie Towaru lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Konsumenta weszła w posiadanie Towaru. </span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>Aby skorzystać z prawa odstąpienia od Umowy Konsument musi poinformować Sklep o swojej decyzji w drodze jednoznacznego oświadczenia (na przykład pismo wysłane pocztą na adres Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań lub za pośrednictwem poczty elektronicznej na adres e-mail kontakt@karolinaszydelko.pl).</span><br /><span>Wzór oświadczenia o odstąpieniu od umowy Sprzedawca udostępnia Konsumentowi poniżej w Regulaminie. </span><br /><span>Konsument może skorzystać z przekazanego wzoru formularza odstąpienia od umowy, jednak nie jest to obowiązkowe. </span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>Jeżeli Konsument skorzysta z możliwości odstąpienia w drodze elektronicznej tj. bądź poprzez przesłanie jednoznacznego oświadczenia o odstąpieniu od Umowy drogą elektroniczną na adres e-mail kontakt@karolinaszydelko.pl, Sprzedawca niezwłocznie prześle Konsumentowi potwierdzenie otrzymania informacji o odstąpieniu od umowy, pocztą elektroniczną (za pośrednictwem wiadomości e-mail). </span><br /><br /></p>\n<div style=\"color:#232323;font-family:Manrope, sans-serif;font-size:16px;font-weight:400;text-align:justify;\">\n<div style=\"text-align:center;\">WZÓR FORMULARZA ODSTĄPIENIA OD UMOWY<br />(formularz ten należy wypełnić i odesłać tylko w przypadku chęci odstąpienia od umowy)</div>\n<br /><br />Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań<br />Tel. 509-904-006, kontakt@karolinaszydelko.pl.<br /><br />Ja/My . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . niniejszym informuję/informujemy o moim/naszym odstąpieniu od umowy sprzedaży następującego/-ych Towaru/ów . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . zawartej dnia . . . . . . . . . . . . . . . . . data odbioru Towaru. . . . . . . . . . . . . . . . . . . . . . . . <br />Imię i nazwisko konsumenta (ów) . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . <br />Adres konsumenta (-ów) . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . <br />Podpis konsumenta(-ów) (tylko jeżeli formularz jest przesyłany w wersji papierowej) <br />Data. . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . .</div>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">Aby zachować termin do odstąpienia od umowy, wystarczy, aby wysłali Państwo informację dotyczącą wykonania przysługującego Państwu prawa odstąpienia od umowy przed upływem terminu do odstąpienia od umowy.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>Skutki odstąpienia od umowy</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">W przypadku odstąpienia od niniejszej umowy zwracamy Państwu wszystkie otrzymane od Państwa płatności, w tym koszty dostarczenia rzeczy (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Państwa sposobu dostarczenia innego niż najtańszy zwykły sposób dostarczenia oferowany przez nas), niezwłocznie, a w każdym przypadku nie później niż 14 dni od dnia, w którym zostaliśmy poinformowani o Państwa decyzji o wykonaniu prawa odstąpienia od niniejszej umowy. Zwrotu płatności dokonamy przy użyciu takich samych sposobów płatności, jakie zostały przez Państwa użyte w pierwotnej transakcji, chyba że wyraźnie zgodziliście się Państwo na inne rozwiązanie; w każdym przypadku nie poniosą Państwo żadnych opłat w związku z tym zwrotem. </p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>Sklep może wstrzymać się ze zwrotem płatności do czasu otrzymania Towaru lub do czasu dostarczenia do Sklepu dowodu jego odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</span><br /><span>Konsument obowiązany jest odesłać lub przekazać Sklepowi Towar na adres Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań, niezwłocznie, a w każdym razie nie później niż 14 dni od dnia, w którym Konsument poinformował Sklep o odstąpieniu od umowy. Termin jest zachowany, jeżeli Konsument odeśle Towar przed upływem terminu 14 dni od dnia, w którym Sklep został poinformowany o decyzji o wykonaniu prawa odstąpienia do umowy.</span><br /><span>Konsument będzie musiał ponieść bezpośrednie koszty zwrotu Towaru w zależności od jego wagi wycenione w wymiarze od 9,50 zł do 27,00 zł. </span><span>Konsument odpowiada tylko za zmniejszenie wartości Towaru wynikające z korzystania z niej w sposób inny niż to konieczne do stwierdzenia charakteru, cech i funkcjonowania rzeczy. </span><br /><br /><span>VIII. Reklamacje dotyczące Towarów</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">8.1. Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań jako sprze­daw­ca odpo­wia­da wobec Klien­ta będą­ce­go kon­su­men­tem w rozu­mie­niu art. 221 Kodek­su Cywil­ne­go, za nie­zgod­no­ść z Umo­wą sprze­da­ży Towa­ru zaku­pio­ne­go przez tego kon­su­men­ta, w zakre­sie okre­ślo­nym Usta­wą o szcze­gól­ny­ch warun­ka­ch sprze­da­ży kon­su­menc­kiej.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">8.2. Rekla­ma­cje, wyni­ka­ją­ce z naru­sze­nia praw Klien­ta gwa­ran­to­wa­ny­ch praw­nie, lub na pod­sta­wie niniej­sze­go Regu­la­mi­nu, nale­ży kie­ro­wać na adres kontakt@karolinaszydelko.pl . Fir­ma Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań zobo­wią­zu­je się do roz­pa­trze­nia każ­dej rekla­ma­cji w ter­mi­nie do 14 dni, a gdy­by to nie było moż­li­we, do poin­for­mo­wa­nia w tym okre­sie Klien­ta, kie­dy rekla­ma­cja zosta­nie roz­pa­trzo­na.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">8.3. Fir­ma Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań nie jest pro­du­cen­tem towa­rów. Pro­du­cent pono­si odpo­wie­dzial­no­ść z tytu­łu gwa­ran­cji sprze­da­ne­go Towa­ru na warun­ka­ch oraz przez okres wska­za­ny w kar­cie gwa­ran­cyj­nej.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">8.4. <span>Sprzedawca (Sklep) ma obowiązek dostarczenia Klientom Towarów bez wad. Ustawa Kodeks Cywilny przewiduje odpowiedzialność Sprzedawcy z tytułu rękojmi, jeżeli rzecz sprzedana ma wadę fizyczną lub prawną. Sprzedawca odpowiada z tytułu rękojmi, jeżeli wada fizyczna Towaru zostanie stwierdzona przed upływem dwóch lat od wydania Towaru Konsumentowi. </span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>8.5. Reklamacja Towaru w czasie objętym rękojmią możliwa jest na przykład poprzez:</span><br /><span>a) przesyłkę listowną na adres Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań; </span><br /><span>c) poprzez kontakt z obsługą sklepu pod nr tel. 509 904 006;</span><br /><br /><span>8.6. Konsument który wykonuje uprawnienia z tytułu rękojmi, jest obowiązany na koszt Sprzedawcy dostarczyć wadliwy Towar na adres do zwrotu: Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań</span><br /><br /><span>8.7. Jeżeli produkt ma wadę, Konsument może złożyć Sprzedawcy reklamację z tytułu rękojmi przysługuje mu wtedy jedna z trzech następujących możliwości:</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>a) wymiana Towaru na nowy;</span><br /><span>b) obniżenie ceny Towaru;</span><br /><span>c) odstąpienia od umowy – o ile wada ma charakter istotny. </span><br /><span>Wybór żądania zależy od Konsumenta. </span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">8.8. Sprzedawca jest zobowiązany do ustosunkowania się do reklamacji w ciągu 14 dni kalendarzowych od dnia złożenia przez Konsumenta oświadczenia o realizacji uprawnień reklamacyjnych. </p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><br /><span>8.9. Jeżeli sprzedany Towar ma wadę, Konsument może żądać wymiany Towaru na wolny od wad albo usunięcia wady Towaru.</span><br /><br /><span>8.10. Jeżeli sprzedany Towar ma wadę, Konsument może złożyć oświadczenie o obniżeniu ceny albo odstąpieniu od umowy, chyba że Sprzedawca niezwłocznie i bez nadmiernych niedogodności dla Konsumenta wymieni wadliwy Towar na wolny od wad. </span><span>Konsument nie może odstąpić od umowy jeżeli wada jest nieistotna.</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>IX. Reklamacje w zakresie świadczenia usług drogą elektroniczną</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">9.1. Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań podejmuje działania w celu zapewnienia w pełni poprawnego działania Sklepu, w takim zakresie, jaki wynika z aktualnej wiedzy technicznej i zobowiązuje się usunąć w rozsądnym terminie wszelkie nieprawidłowości zgłoszone przez Klientów.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">9.2. Klient zobowiązany jest niezwłocznie powiadomić Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań o wszelkich nieprawidłowościach lub przerwach w funkcjonowaniu serwisu Sklepu Internetowego.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">9.3. Nieprawidłowości związane z funkcjonowaniem Sklepu Klient może zgłaszać pisemnie na adres: Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań lub przy użyciu formularza kontaktowego.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">9.4. W reklamacji Klient powinien podać swoje imię i nazwisko, adres do korespondencji, rodzaj i datę wystąpienia nieprawidłowości związanej z funkcjonowaniem Sklepu.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">9.5. Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań zobowiązuje się do rozpatrzenia każdej reklamacji w terminie do [14] dni, a gdyby to nie było możliwe, do poinformowania w tym okresie Klienta, kiedy reklamacja zostanie rozpatrzona.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>X. Postanowienia końcowe</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">10.1. Rozstrzyganie ewentualnych sporów powstałych pomiędzy Media Art Karolina Filipowicz, ul. Jaśminowa 19, 68-100 Żagań a Klientem, który jest konsumentem w rozumieniu art. 221 Kodeksu Cywilnego, zostaje poddane sądom właściwym zgodnie z postanowieniami właściwych przepisów Kodeksu postępowania cywilnego.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>10.2. Niniejszy regulamin świadczenia spełnia wymogi określone ustawą z dnia 18 lipca 2002 r. o świadczeniu usług drogą elektroniczną (Dz. U. Nr 144, poz. 1204 z późn. zm.) </span><br /><br /><span>10.3. Dla celów wykonania regulaminu oraz umowy, zastosowanie ma prawo polskie. W przypadku sporu z konsumentem stosowane będą korzystniejsze przepisy prawa jego miejsca zamieszkania. </span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>10.4. We wszelkich sprawach nieuregulowanych w niniejszym Regulaminie, mają zastosowanie przepisy Kodeksu Cywilnego, Ustawa o prawach konsumenta, a także inne przepisy obowiązującego prawa.</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">10.3. W sprawach nieuregulowanych w niniejszym Regulaminie mają zastosowanie przepisy Kodeksu cywilnego, przepisy Ustawy o świadczeniu usług drogą elektroniczną oraz inne właściwe przepisy prawa polskiego.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\">10.5. <span>Korzystanie z serwisu www.karolinaszydelko.pl oznacza akceptację niniejszego Regulaminu.</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>XI. Polityka plików Cookies</span></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.9375rem;font-weight:400;color:#7a7a7a;font-family:Manrope, sans-serif;text-align:justify;\"><span>11.1. </span>Sprzedawca stosuje mechanizm plików \"cookies\", które podczas korzystania przez Klientów ze Strony Internetowej Sklepu, zapisywane są przez serwer Sprzedawcy na dysku twardym urządzenia końcowego Klienta. Stosowanie plików \"cookies\" ma na celu poprawne działanie Strony Internetowej Sklepu na urządzeniach końcowych Klientów. Mechanizm ten nie niszczy urządzenia końcowego Klienta oraz nie powoduje zmian konfiguracyjnych w urządzeniach końcowych Klientów ani w oprogramowaniuzainstalowanym na tych urządzeniach. Każdy Klient może wyłączyć mechanizm „cookies” w przeglądarce internetowej swojego urządzenia końcowego. Sprzedawca wskazuje, że wyłączenie „cookies” może jednak spowodować utrudnienia lub uniemożliwić korzystanie ze Strony Internetowej Sklepu.</p>','regulamin-sklepu'),
